import "bootstrap/dist/css/bootstrap.min.css";
import React from "react";
import "react-animated-slider/build/horizontal.css";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import ReactDOM from "react-dom";
import AboutSection from "./components/AboutSection";
import ProjectPage from "./components/ProjectPage";
import SideBarContent from "./components/SideBarContent";
import "./index.css";

import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Scroll from "react-scroll";

export const ABOUT = {
  INTRO:
    "Welcome! I'm primarly interested in backend development, but always looking to learn new tech for new problems. Currently nerding out about lambda calculus and   Thanks for stopping by!",
  EMPLOYMENT: "Currently looking for employment.",
  BUILT: "This website was made using React.",
  HEADLINE: "Software Developer",
  EMAIL: "pwamsley2019@gmail.com",
  GITHUB: "pwamsley2015.github.com",
  INSTA: "https://www.instagram.com/patrick_wamsley/",
  LINKED_IN: "https://www.linkedin.com/in/patrick-wamsley-32216b108/",
  PERSONAL: "",
  TITLE: "BS, Computer Science",
  SBU: "Stony Brook University",
};

class HomeScreen extends React.Component {
  render() {
    return (
      <div
        className="home_screen"
        style={{
          display: "flex",
          background: "#303C55",
          color: "#e6f1ff",
        }}
      >
        <Navbar bg="dark" variant="dark" fixed="top">
          <Navbar.Brand>
            <h1>Patrick Wamsley</h1>
          </Navbar.Brand>
          <Nav className="mr-auto">
            <Nav.Link
              href="#project_page"
              onSelect={() => {
                let projectsPage = document.querySelector("#project_page");
                projectsPage.scrollIntoView({
                  behavior: "smooth",
                  block: "start",
                });
                projectsPage.scrollTop -= 100;
              }}
            >
              Projects
            </Nav.Link>
            <Nav.Link href="resume.pdf">Resume PDF</Nav.Link>
          </Nav>
        </Navbar>

        <div style={{ width: "100%" }}>
          <SideBarContent className="sidebar" />
          <div className="main">
            <AboutSection />
            <div id="project_page" className="scroll-with-offset">
              <ProjectPage />
            </div>
          </div>
        </div>
      </div>
    );
  }
}

ReactDOM.render(<HomeScreen />, document.getElementById("root"));
